import React from 'react';
import { Link } from 'react-router-dom';
import Table from 'react-bootstrap/Table';
import { getProbands, getPheno } from '../helpers/get-probands';

import { userService } from '../services/user.service';

class HomePage extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            user: {},
            users: [],
            probands: []
        };
    }

    componentDidMount() {
        this.setState({ 
            user: JSON.parse(localStorage.getItem('user')),
            users: { loading: true },
            probands: [],
            phenotypes: []
        });

        userService.getAll().then(users => this.setState({ users }));
        getProbands().then(probands => this.setState({ probands }));
        for (i = 0; i < probands.length; i++) {
            getPheno(probands[i].proband).then(phenotype => this.setState({ index : phenotype }))
        };
    }

    render() {
        const { user, users } = this.state;
        return (
            <div>
            <div className="col-md-6 col-md-offset-3">
                <h1>Hi {user.firstName}!</h1>
                <p>You're logged in with React & Basic HTTP Authentication!!</p>
                <h3>Users from secure api end point:</h3>
                {users.loading && <em>Loading users...</em>}
                {users.length &&
                    <ul>
                        {users.map((user, index) =>
                            <li key={user.id}>
                                {user.firstName + ' ' + user.lastName}
                            </li>
                        )}
                    </ul>
                }
            </div>
            <Table striped bordered hover variant="dark">
            <thead>
                <tr>
                <th>#</th>
                <th>Proband</th>
                <th>Phenotype</th>
                </tr>
            </thead>

            <tbody>
                {Array.from({ length: probands.length }).map((_, index) => (
                    <tr key={index}>
                        <td>{index}</td>
                        <td>{getPheno(probands[index].proband)}</td>
                        <td>{}</td>
                    </tr>
                ))}
            </tbody>

            </Table>
            <p>
                <Link to="/login">Logout</Link>
            </p>
            </div>
        );
    }
}

export { HomePage };
